import { getDepartments, getProducts } from "../../services/catalog"

export const setFilter = department => {
  return {
    type: "SET_FILTER",
    filter: department
  };
};

export const clearFilter = () => {
  return {
    type: "CLEAR_FILTER"
  };
};

export const initCatalog = () => {
  // Fetch data from an external service
  return {
    type: "INITIALIZE_CATALOG",
    departments: [],
    products: []
  }
}
